import "./style.css";

function Footer(){
    return(
        <section className="footer">
            <div className="footer_container">
                <div className="footer_container_top">
                    <div></div>
                    <div></div>
                    <div></div>
                </div>
                <div className="footer_container_bottom"></div>
            </div>
        </section>
    )
}
export default Footer;
